import React from 'react';

const TrackList = ({ tracks, onPlay }) => {
    return (
        <div>
            {tracks.map(track => (
                <div key={track.id} onClick={() => onPlay(track.preview)}>
                    {track.title} by {track.artist.name}
                </div>
            ))}
        </div>
    );
};

export default TrackList;
